import React from 'react';

class List extends React.Component {
    state = {
        logged: false
    }

    render() {    
        <div>
            <button onClick={this.login}>Inicia sesión</button>
            <p>Inicia sesión para ver contenido privado</p>
        </div>
    }
}

export default List;
